import React from 'react';
import Wallet from '../components/Wallet';
import '../styles/Wallets.css';
import windows from '../media/images/windows.png';
import apple from '../media/images/apple.png';

const Wallets = () => {
    return (
        <div className="wallet__container">
            <div className="wallet__header">Wallets</div>

            <div className="wallet__box">
                <Wallet name='Windows 32-Bit' message='Download' image={windows} alt='windows logo'/>
                <Wallet name='Windows 64-Bit' message='Download' image={windows} alt='windows logo'/>
                <Wallet name='macOS' message='Download' message='Download' image={apple} alt='apple logo'/>
                <Wallet name='macOS' message='Download' message='Download' image={windows} alt='windows'/>
                <Wallet name='macOS' message='Download' message='Download' image={windows} alt='windows'/>
            </div>
        </div>
    )
}

export default Wallets
